import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 50px;
  background: #20295f;
  border-top: 3px solid #ee6b25;

  position: fixed;
  bottom: 0;

  display: flex;
  align-items: center;

  span {
    color: #fff;
  }
`;
